import React from 'react'
import JsonData from './data.json'
//import styled from 'styled-components';

export default function Players() {

  const displayData = JsonData.map((player) => {
    return(
      <tr>
        <td>{player.name}</td>
        <td>{player.points}</td>
      </tr>
    )
  }
  )

  return (

      <table className='table table-striped'>
        <thead>
          <tr>
            <th>Name</th>
            <th>Points</th>
          </tr>
        </thead>

        <tbody>
          {displayData}
        </tbody>
      </table>

  );
}
